import React from 'react';

function Seeds(props) {
    return (
        <div className='product-container'>
           <ul className='product'>
            <li>
                <img src={props.src} alt={props.name}/>
               <h1>{props.name}</h1>
            </li>
           </ul>
        </div>
    );
}

export default Seeds;
